library CertifierLib {
    using IbaseLib for bytes;

    struct Certifier {
        Timeline timeline;
        TimelineDocument claim;
        TimelineDocument[] proofs;
        address[] certifiers;
    }

    function createProof(Certifier storage self, bytes proof) {
        addProof(self, TimelineDocument(proof.createContractFromBytes()));
    }

    function addProof(Certifier storage self, TimelineDocument proof) {
        self.proofs.push(proof);
    }

    /**
     * Selects the certifiers to participate in this instance of the certification protocol
     */
    function selectCertifiers(Certifier storage self) {}
}
